public int getMaxValueOfPackage2(int n, int m, int[] v, int[] val) 
{
    int[] dp = new int[m+1];
    for(int i=1; i<=n; i++)
    {
        for(int j=m; j>=v[i-1]; j--)
        {
            dp[j] = Math.max(dp[j], dp[j-v[i-1]]+val[i-1]);
        }
    }
    return dp[m];
}

public int getMaxValueOfPackage2(int n, int m, int[] v, int[] val){
    int[] dp = new int[m + 1];
    for (int i = 1; i <= n; i++) {
        //优化使用j>=v[i-1], 仅需要查看 v[i-1] ~ m 这个体积区间的最大价值是否需要更新
        for (int j = m; j >=v[i-1]; j--) {
            dp[j] = Math.max(dp[j], dp[j-v[i-1]] + val[i-1]);
        }
    }
    return dp[m];
}

